  input: '"TEXT","F3A","C00393629","This is in response to your letter dated March
    14, 2006.    1.  Your letter stated that our committee disclosed one or more contributions
    that appear to exceed the limits set forth in the Act.  After reviewing our original
    report, I found that we do NOT exceed any limits.  What appeared to be excessive
    was in fact contributions for primary 2004 and general 2004 debt retirement (as
    disclosed on the original report for Frank Drendel & Cliff Andrews).  I spoke
    to with Alan Shook,  FEC Senior Campaign Finance Analyst,  on April 12, 2006,
    and he reviewed our reports again and found that it was indeed an oversight on
    his part, so no action needs to be taken by our committee.   2.   Please note
    that we have net debt outstanding for the following elections:  Primary 2004,
    Runoff 2004 and General 2004.  3.  FEC Form 3Z-1 is attached to this amendment.  We
    recently converted to a different campaign software.  Because of this, we overlooked
    including Form 3Z-1 with our original filing.  4.  Back Americas Conservatives
    PAC acted as a conduit for 3 separate contributions totalling $3,000.00.  These
    3 have been itemized on this amendment as earmarked contributions."'
